import React, { Component } from "react";
import Form from "../form/Form";
import { withRouter } from "react-router-dom";
import Button from "../button/Button";

export class Inquiry extends Component {
  render() {
    return (
      <div className="pagez">
        <h1>Гүйлгээ</h1>
        <div className="form_holder">
          <Form placeholder="checksum" id="1" />
          <Form placeholder="transaction_id" id="2" />
        </div>
        <Button onclk={this.noob} whichcomp="inquiry"></Button>
      </div>
    );
  }
  noob = () => {
    this.props.history.push("/api/showdata");
  };
}

export default withRouter(Inquiry);
